                mraid.addEventListener('ready', onSdkReady);
            } else {
                // Otherwise, if the SDK is ready, execute your function:
                onSdkReady();
            }


            class SceneLoader extends Phaser.Scene {

                constructor() {
                    super({ key: 'sceneLoader' });
                }

                preload() {
                    this.textures.addBase64('background', backgroundURI);
                    this.textures.addBase64('man', manURI);
                    this.textures.addBase64('female', femaleURI);
                    this.textures.addBase64('hand', handURI);
                    this.textures.addBase64('whoLead', whoLeadURI);
                    this.textures.addBase64('boton', botonURI);
                    this.textures.addBase64('gotowar', gotowarURI);
                    this.textures.addBase64('logo', logoURI);
                    this.textures.addBase64('HBO', HBOURI);
                    this.textures.addBase64('spark', sparkURI);
                    console.log("load");
                }

                create() {
                    this.scene.switch('sceneA');
                }

                update() {

                }

            }

            class SceneA extends Phaser.Scene {

                constructor() {
                    super({ key: 'sceneA' });
                }

                preload() { }

                create() {
                    viewport = new Phaser.Geom.Rectangle();



                    console.log(this.sys.scale.canvasBounds)
                    this.textures.on('addtexture', function () {
                        background = this.add.sprite(683, 683, 'background');
                        background.setScale(1.5);

                        man = this.add.sprite(600, 1000, 'man');
                        man.setScale(0.85);
                        man.setTint(0x666666);
                        man.setInteractive();
                        female = this.add.sprite(175, 865, 'female');
                        female.setScale(0.88);
                        female.setInteractive();
                        hand = this.add.sprite(female.x, female.y, 'hand');

                        whoLead = this.add.sprite(384, this.sys.game.canvas.height - 150, 'whoLead');
                        whoLead.setScale(0);
                        gotowar = this.add.sprite(384, this.sys.game.canvas.height - 150, 'gotowar');
                        gotowar.setScale(0);
                        gotowar.setInteractive();
                        hbo = this.add.sprite(200 + (760 / 2), this.sys.game.canvas.height - 25, 'HBO');
                        logo = this.add.sprite((this.sys.game.canvas.width) / 2, this.sys.game.canvas.height - 1256, 'logo');

                        this.changePos();
                        this.animationsTweens(this);
                        this.animationTimeLines(this);
                        this.animationBottons(this);
                    }, this);

                    this.getViewport(this.scale, viewport);
                    this.scale.on('resize', this.changePos, this);



                    this.input.on('gameobjectdown', function (pointer, gameObject) {
                        if (hand != null) {
                            hand.destroy();
                            hand = null;
                            animationHand.stop();
                            animationFemale.stop();
                            animationMan.stop();
                            stopTint = true;
                        }

                        if (gameObject == female) {
                            state = "finish";
                            animationFemaleIn.play();
                            animationManOut.play();
                            female.setTint(0xffffff);
                            animationBotonOut.play();
                            //man.setDepth(-1);
                        }

                        if (gameObject == man) {
                            state = "finish";
                            animationFemaleOut.play();
                            animationManIn.play();
                            man.setTint(0xffffff);
                            animationBotonOut.play();
                            //female.setDepth(-1);
                        }

                        if (gameObject == gotowar) {
                            this.clickFunction();
                        }
                    }, this);
                    //const cam = this.cameras.main;
                    //cam.setViewport(0, 0, 768, 433)
                    //cam.zoom = 1;
                    //cam.scrollY = 200;
                    //this.checkOriention(this.scale.orientation);
                    //this.scale.on('resize', this.checkOriention, this);
                    //console.log(cam);
                }
                clickFunction() {
                    console.log("done");
                    userClickedDownloadButton();
                    //Dapi.openStoreUrl();
                }
                update() {
                    if (hand != null) {
                        if (hand.x > (viewport.centerX + 50))
                            if (ani1 == false) {
                                ani1 = true;
                                animationMan.restart();

                            }

                        if (hand.x < (viewport.centerX - 50)) {
                            if (ani2 == false) {
                                ani2 = true;
                                animationFemale.restart();
                            }
                        }

                    }
                }

                changePos() {
                    this.getViewport(this.scale, viewport);

                    logo.setPosition(logo.displayWidth + (viewport.left), viewport.top + logo.displayHeight);
                    hbo.setPosition(viewport.centerX, (viewport.bottom) - hbo.displayHeight);

                    whoLead.setPosition(viewport.centerX, (viewport.bottom - 175) - whoLead.displayHeight);
                    gotowar.setPosition(viewport.centerX, (viewport.bottom - 175) - whoLead.displayHeight);

                    if (state === "init") {
                        if (viewport.height > viewport.width) {
                            female.setPosition(viewport.left + 200, (viewport.centerY / 2) + (female.displayHeight / 2));
                            man.setPosition(viewport.right - 200, (viewport.centerY / 2) + (female.displayHeight / 2) + 100);
                        }
                        else {
                            female.setPosition(viewport.left + 400, (viewport.centerY / 2) + (female.displayHeight / 2) + 100);
                            man.setPosition(viewport.right - 400, (viewport.centerY / 2) + (female.displayHeight / 2) + 220);
                        }
                    }
                    if (viewport.width < 750) {
                        hbo.setScale(0.8);
                    } else hbo.setScale(1);

                    hand.setPosition(female.x - 25, female.y);
                    //animationHand.updateTo('target', hand, true);
                }

                getViewport(scaleManager, out) {
                    if (out === undefined) {
                        out = new Phaser.Geom.Rectangle();
                    }

                    var baseSize = scaleManager.baseSize;
                    var canvasBounds = scaleManager.canvasBounds;
                    var displayScale = scaleManager.displayScale;
                    var parentSize = scaleManager.parentSize;

                    out.x = (canvasBounds.x >= 0) ? 0 : -(canvasBounds.x * displayScale.x);
                    out.y = (canvasBounds.y >= 0) ? 0 : -(canvasBounds.y * displayScale.y);

                    var width = baseSize.width - (canvasBounds.width - parentSize.width) * displayScale.x;
                    out.width = Math.min(baseSize.width, width);
                    var height = baseSize.height - (canvasBounds.height - parentSize.height) * displayScale.y;
                    out.height = Math.min(baseSize.height, height);
                    return out;
                };

                animationBottons(scope) {
                    animationBoton = scope.tweens.add({
                        targets: whoLead,
                        scaleX: 1,
                        scaleY: 1,
                        duration: 1200,
                        delay: 500,
                        ease: 'Bounce.easeOut',
                    });

                    animationBotonOut = scope.tweens.add({
                        targets: whoLead,
                        scaleX: 0,
                        scaleY: 0,
                        alpha: 0,
                        duration: 400,
                        ease: 'Sine.easeInOut',
                        paused: true,
                    });

                    animationBoton2 = scope.tweens.add({
                        targets: gotowar,
                        scaleX: 1,
                        scaleY: 1,
                        alpha: 1,
                        duration: 1200,
                        ease: 'Bounce.easeOut',
                        paused: true,
                        onComplete: function () {
                            animationBoton3.resume();
                        }
                    });

                    animationBoton3 = scope.tweens.add({
                        targets: gotowar,
                        scaleX: 0.9,
                        scaleY: 0.9,
                        duration: 600,
                        ease: 'Quad.easeInOut',
                        paused: true,
                        yoyo: true,
                        repeat: -1
                    });
                }

                animationsTweens(scope) {

                    animationHand = this.tweens.add({
                        targets: hand,
                        props: {
                            x: { value: function () { return (man.x + 100); } },
                            y: { value: function () { return (man.y - 250); } }
                        },
                        duration: 1400,
                        ease: 'Sine.easeInOut',
                        yoyo: true,
                        repeat: -1
                    });

                    animationMan = scope.tweens.add({
                        targets: man,
                        scaleX: 0.9,
                        scaleY: 0.9,
                        duration: 700,
                        delay: 200,
                        ease: 'Sine.easeInOut',
                        yoyo: true,
                        paused: true,
                        onActive: function () { man.setTint(0xffffff); },
                        onComplete: function () {
                            ani1 = false;
                            if (stopTint == false) {
                                man.setTint(0x666666);
                            }
                        }
                    });

                    animationFemale = scope.tweens.add({
                        targets: female,
                        scaleX: 0.95,
                        scaleY: 0.95,
                        duration: 700,
                        ease: 'Sine.easeInOut',
                        yoyo: true,
                        paused: false,
                        onActive: function () { female.setTint(0xffffff); },
                        onComplete: function () {
                            ani2 = false;
                            if (stopTint == false) {
                                female.setTint(0x666666);
                            }
                        }
                    });

                }


                animationTimeLines(scope) {


                    animationFemaleIn = scope.tweens.createTimeline()
                    animationFemaleIn.add({
                        targets: female,
                        scaleX: 1,
                        scaleY: 1,
                        x: viewport.centerX,
                        duration: 1000,
                        ease: 'Sine.easeInOut',
                        onActive: function () { female.setTint(0xffffff); },
                        onComplete: function () { female.setTint(0xffffff); animationBoton2.resume(); }
                    });

                    animationManOut = scope.tweens.createTimeline()
                    animationManOut.add({
                        targets: man,
                        scaleX: 0,
                        scaleY: 0,
                        alpha: 0,
                        duration: 500,
                        ease: 'Sine.easeInOut',
                    });

                    animationManIn = scope.tweens.createTimeline()
                    animationManIn.add({
                        targets: man,
                        scaleX: 1,
                        scaleY: 1,
                        x: viewport.centerX,
                        duration: 1000,
                        ease: 'Sine.easeInOut',
                        onActive: function () { man.setTint(0xffffff); },
                        onComplete: function () { man.setTint(0xffffff); animationBoton2.resume(); }
                    });

                    animationFemaleOut = scope.tweens.createTimeline()
                    animationFemaleOut.add({
                        targets: female,
                        scaleX: 0,
                        scaleY: 0,
                        x: -1000,
                        alpha: 0,
                        duration: 500,
                        ease: 'Sine.easeInOut',
                    });
                }

            }
            config = {
                title: "Game",
                version: "0.0.1",
                type: Phaser.WEBGL,
                parent: "phaser_container",
                scale: {
                    mode: Phaser.Scale.ENVELOP,
                    autoCenter: Phaser.Scale.CENTER_BOTH,
                    width: 1366,
                    height: 1366

                },
                pixelArt: false,
                scene: [SceneLoader, SceneA]
            };
            var gameObject2 = new Phaser.Game(config);
        }
        function onSdkReady() {
            mraid.addEventListener('viewableChange', viewableChangeHandler);

            if (mraid.isViewable()) {
            showMyAd();
            }

        }

        function userClickedDownloadButton(event) {
            var userAgent = navigator.userAgent || navigator.vendor;
            var url = "APP_STORE_LINK";
            var android = "GOOGLEPLAY_LINK";
            if (/android/i.test(userAgent)) { url = android; }
            mraid.open(url);
        }

        function viewableChangeHandler(viewable) {

        }
        function showMyAd() {
        }
    </script>
</body>
